-- ----------------------------
--  Table structure for `ddc_admin`
-- ----------------------------
DROP TABLE IF EXISTS `ddc_admin`;
CREATE TABLE `ddc_admin` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `name` varchar(25) COLLATE utf8_bin NOT NULL COMMENT '姓名',
  `password` varchar(255) COLLATE utf8_bin NOT NULL COMMENT '密码 密文',
  `salt` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '加密盐值',
  `sex` tinyint(2) DEFAULT '0' COMMENT '性别 0 男 1 女 默认 0',
  `mobile` varchar(15) COLLATE utf8_bin DEFAULT NULL COMMENT '手机号码 ',
  `email` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '邮箱',
  `role_id` bigint(20) NOT NULL COMMENT '角色ID',
  `remark` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '备注',
  `create_by` bigint(20) NOT NULL COMMENT '创建人',
  `create_time` bigint(20) NOT NULL COMMENT '创建时间',
  `update_by` bigint(20) DEFAULT NULL COMMENT '更新人',
  `update_time` bigint(20) DEFAULT NULL COMMENT '更新时间',
  `status` tinyint(2) DEFAULT NULL COMMENT '启用、禁用  1 启用 2 禁用',
  `del_flag` tinyint(2) NOT NULL DEFAULT '0' COMMENT '删除标志 0 未删除 1 已删除 默认 0',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE KEY `name` (`name`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=213 DEFAULT CHARSET=utf8 COLLATE=utf8_bin ROW_FORMAT=DYNAMIC;

