-- ----------------------------
--  Table structure for `ddc_authority`
-- ----------------------------
DROP TABLE IF EXISTS `ddc_authority`;
CREATE TABLE `ddc_authority` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `name` varchar(20) COLLATE utf8_bin NOT NULL COMMENT '权限名称',
  `flag` varchar(255) COLLATE utf8_bin NOT NULL COMMENT '权限标识',
  `p_id` bigint(20) NOT NULL DEFAULT '0' COMMENT '上级权限 顶级权限的上级权限是 0',
  `level` tinyint(2) NOT NULL DEFAULT '2' COMMENT '级别 0 模块权限 1 菜单权限 2 操作权限 默认是2',
  `auth_level` tinyint(2) DEFAULT '3' COMMENT '权限级别   1 超级管理员权限 2 管理员权限 3 普通权限',
  `menu_url` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '菜单地址 页面级权限特有 ',
  `create_by` bigint(20) NOT NULL COMMENT '创建人',
  `create_time` bigint(20) NOT NULL COMMENT '创建时间',
  `update_by` bigint(20) DEFAULT NULL COMMENT '修改人',
  `update_time` bigint(20) DEFAULT NULL COMMENT '修改时间',
  `del_flag` tinyint(2) NOT NULL DEFAULT '0' COMMENT '删除标志 0 未删除 1 已删除 默认 0',
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE KEY `flag` (`flag`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=25 DEFAULT CHARSET=utf8 COLLATE=utf8_bin ROW_FORMAT=DYNAMIC;

