-- ----------------------------
--  Table structure for `ddc_suggestings`
-- ----------------------------
DROP TABLE IF EXISTS `ddc_suggestings`;
CREATE TABLE `ddc_suggestings` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `username` varchar(25) COLLATE utf8_bin NOT NULL COMMENT '用户名',
  `sex` tinyint(2) NOT NULL DEFAULT '2' COMMENT '性别 0 男 1 女 2 保密 默认保密',
  `mobile` varchar(20) COLLATE utf8_bin NOT NULL COMMENT '手机号',
  `email` varchar(255) COLLATE utf8_bin NOT NULL COMMENT '邮箱',
  `path` varchar(255) COLLATE utf8_bin DEFAULT '' COMMENT '附件地址 ',
  `city` tinyint(4) DEFAULT NULL COMMENT '城市ID',
  `remark` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '留言内容',
  `create_time` bigint(20) NOT NULL,
  `create_by` bigint(20) NOT NULL,
  `update_time` bigint(20) DEFAULT NULL,
  `update_by` bigint(20) DEFAULT NULL,
  `del_flag` tinyint(2) NOT NULL,
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=102 DEFAULT CHARSET=utf8 COLLATE=utf8_bin ROW_FORMAT=DYNAMIC;

